                background-color: rgba(0, 0, 0, 0.6);
                opacity: 0;
                visibility: hidden;
                -webkit-backface-visibility: hidden;
                        backface-visibility: hidden;
                transition: opacity 0.6s cubic-bezier(0.55, 0, 0.1, 1), visibility 0.6s cubic-bezier(0.55, 0, 0.1, 1);
