            var intervalHolder;
            
            (function($) {
                $.fn.writeIntro = function() {
                    var current = 0,
                        elem = this;
                        intervalHolder = setInterval(function() {
                            if(current < introLines.length) {
                                elem.text(introLines[current++]);
                            } else {
                                setTimeout(function(){
                                    $("#intro, #fast-forward").hide();
                                    $(".first-button-group").show();
                                }, 2000);
                            }
                        }, 2500);
                };
                
                $.fn.bodyBGChange = function() {
                    var current = 0;
                    setInterval(function() {
                        if(current < colorArray.length) {
                            $("body").css("background-color",colorArray[current]);
                            $("#bg-lines").css("fill", colorArray[current]);
//                            $("#bg-lines path").css("fill", colorArray[current]);
                            current++;
                        }
                    }, 10000);
                };
            
            })(jQuery);
            
            $(document).ready(function() {
                $.fn.bodyBGChange();
                $("#intro").writeIntro();
                
                $('.close-modal').click(function(){
                    elements.removeClass('active');
                    $(".content").css("visibility","visible");
                });
                
            });
            
            function showContent(contentType) {
                const modalContent =  content[contentType].data;
                $(".modal .modal-content").html(modalContent);
                elements.addClass('active');
                $(".content").css("visibility","hidden");
            }
            
            function skipIntro(){
                clearInterval(intervalHolder);
                $("#intro, #fast-forward").hide();
                $(".first-button-group").show();
            }
            
            function validate(form){
                if(document.contactform.username.value==''
                ||document.contactform.email.value==''
                ||document.contactform.message.value==''){
                    $("#rtnMsg").text("Please Enter All Details");
                    $("#rtnMsg").css("display","block");
                } else {
                    $.ajax(  {
        				data: new FormData(form),
        				url: 'mail.php',
        				type: 'POST',
        				contentType: false,
        				cache: false,
        				processData:false,
        				
        				success: function(out) {
        					var arrResponse = JSON.parse(out);
        					rtnMsg = arrResponse.rtnMsg;
        					success = arrResponse.success;
        				},
        
        				error: function(jqXHR, exception) {
        					if (jqXHR.status === 0) {
        						rtnMsg = 'Not connect.\n Verify Network.';
        					} else if (jqXHR.status == 404) {
        						rtnMsg = 'Requested page not found. [404]';
        					} else if (jqXHR.status == 500) {
        						rtnMsg = 'Internal Server Error [500].';
        					} else if (exception === 'parsererror') {
        						rtnMsg = 'Requested JSON parse failed.';
        					} else if (exception === 'timeout') {
        						rtnMsg = 'Time out error.';
        					} else if (exception === 'abort') {
        						rtnMsg = 'Ajax request aborted.';
        					} else {
        						rtnMsg = 'Uncaught Error.\n' + jqXHR.responseText;
        					}
        					success = '0';
        					$("#rtnMsg").text(rtnMsg);
                            $("#rtnMsg").css("display","block");
        				}
        			}).done(function() {
        					$("#rtnMsg").text(rtnMsg);
                            $("#rtnMsg").css("display","block");
        			});
                }
                setTimeout(function(){
                    $("#rtnMsg").css("display","none");
                }, 3000);
                return false;
            }
            
        </script>
